import React from "react";
import { Navigate } from "react-router-dom";

const Logout = () => {

    localStorage.clear()
    Navigate('/')

    return (
        <>
        <button type="button" onClick={Logout} class="btn btn-danger">Logout</button>
        </>
    )
}


export default Logout;
